            "description": "<p>Could fall weather be any better? \u00a0I believe there's a clear answer right now and that's nope. \u00a0</p> <p>So go ahead and mark your calendars for the first Tuesday of November! \u00a0We've got a solid lineup of presenters with a couple more to be announced soon. \u00a0See you then! \u00a0</p> <p>\n\n6:00pm - 6:45pm Food, drinks and networking\u00a0<br/>6:45pm - 6:55pm Introductions and Announcements\u00a0<br/>6:55pm - 8:00pm Presentations</p> <p>* Mike Bland - 18F\u00a0<br/>*\u00a0Irakli Nadareishvili - API Academy<br/>* Lisa\u00a0Gelobter - US Digital Service<br/>* David Berlind - ProgrammableWeb</p> <p><br/>7:55pm - 8:00pm Refill your beverage\u00a0<br/>8:00pm - 8:30pm Panel discussions\u00a0<br/>8:30pm - 9:00pm Networking</p>", 
