            "created": 1445992584000, 
            "description": "<p>For our November Data Science DC, we're thrilled to have to speakers talk about machine learning algorithms and how they can be socially responsible, or not. Mike Williams from Fast Forward Labs in NYC will be talking about how supervised learning algorithms can amplify existing inequality, and Prof. Lisa Singh from Georgetown will present her research on the digital trails we leave on the web. Much of the Big Data revolution is our new ability to analyze extensive, detailed data generated by people and their behavior -- these presentations will provide you with insights into what you can do better to leverage this data in a responsible way.</p> <p>NOTE: The venue for this event is still being confirmed, but we expect to post it momentarily. It'll almost certainly be downtown, near the White House.</p> <p><b>Agenda:</b></p> <p>\u2022\u00a06:30pm -- Networking, Empanadas, and Refreshments</p> <p>\u2022\u00a07:00pm -- Introduction, Announcements</p> <p>\u2022\u00a07:15pm -- Presentations and Discussion</p> <p>\u2022\u00a08:30pm -- Data Drinks (<i>TBA</i>)</p> <p><b>Presentations:</b></p> <p><i>Mike Williams:</i></p> <p>This talk will use the example of sentiment analysis to show that supervised machine learning has the potential to amplify the voices of the most privileged people in society. A sentiment analysis algorithm is considered \u2018table stakes\u2019 for any serious text analytics platform in social media, finance, or security. As an example of supervised machine learning, I\u2019ll show how these systems are trained. But I'll also show that they have the unavoidable property that they are better at spotting unsubtle expressions of extreme emotion. Such crude expressions are used by a particularly privileged group of authors: men. In this way, brands that depend on sentiment analysis to 'learn what people think' inevitably pay more attention to men. But the problem doesn't stop with sentiment analysis: at every step of any model building process, we make choices that can introduce bias, enhance privilege, or break the law! I'll review these pitfalls, talk about how you can recognise them in your own work, and touch on some new academic work that aims to mitigate these harms.\u00a0</p> <p>Mike Williams is a research engineer at <a href=\"http://www.fastforwardlabs.com/\">Fast Forward Labs</a>, which helps organizations accelerate their data science and machine intelligence capabilities by profiling near future technologies from academia and elsewhere, producing reports on their development and prototypes demonstrating their application. He has a PhD in astrophysics from Oxford, and did postdocs at the Max Planck Institute in Munich and at Columbia University. Follow Mike on Twitter <a href=\"https://twitter.com/williamsmj_\">@williamsmj_</a>.</p> <p><br/><i>Lisa Singh:</i></p> <p>Helping Users Understand Their Web Footprint</p> <p>With the growth of online social networks and social media sites, the increase in dynamic web content, and the popularity of digital communication, more and more public information about individuals is available on the Internet. This talk will present a\u00a0novel information exposure detection framework that generates and analyzes the web footprints users leave across the social web. Our approach uses probabilistic operators, free text attribute extraction, and a population-based inference engine to generate the web footprints.\u00a0Using a web footprint, the framework then quantifies a user\u2019s level of information exposure relative to others and makes suggestions on which attributes to remove or hide.\u00a0 After presenting the framework, I will show an evaluation that quantifies information exposure on\u00a0 public profiles from\u00a0Google+, LinkedIn, FourSquare, and Twitter.\u00a0Finally, the talk will conclude with a brief discussion about data privacy and ethics.</p> <p>Dr. <a href=\"http://people.cs.georgetown.edu/~singh/\">Lisa Singh</a> is the Graduate Director and an Associate Professor in the Department of Computer Science at Georgetown University.\u00a0Her research interests are in data science, data mining, and databases. She currently has funding from NSF to study privacy on the web (adversarial inference), dolphin social structures with the Shark Bay Dolphin Research project (graph databases, visual analytics and social mining) and forced migration with the Institute for the Study of International Migration, LLNL, York University and others (text mining, graph mining, event detection).\u00a0Dr. Singh received her B.S.E. degree from Duke University and her M.S. and Ph.D. degrees from Northwestern University.\u00a0She has served on many organizing and program committees, including KDD, ICDM, ICDE, and SIGMOD, and is currently involved in different organizations related to women in computing and computational thinking education for K-12.</p> <p><b>Sponsors:</b></p> <p>This event is sponsored by <a href=\"http://bit.ly/12YljkP\">Statistics.com</a>,\u00a0<a href=\"https://hired.com/\">Hired</a>,\u00a0<a href=\"http://datamininglab.com/\">Elder Research</a>,\u00a0and\u00a0<a href=\"https://www.boozallen.com/consulting/strategic-innovation/nextgen-analytics-data-science\">Booz Allen Hamilton</a>.\u00a0(Would your organization like to sponsor too? Please get in touch!)\u00a0</p>", 
